import React from 'react'
import { FiHome } from 'react-icons/fi';

function Error404() {
    return (
        <div className="text-center">
            <h1 className="text-primary">Error <span className="text-danger">404</span></h1>
            <p className="text-primary">Oops ! Something Went Wrong</p>
            <button className="btn btn-primary"><FiHome className="me-2" />Go Home</button>
        </div>
    )
}

export default Error404;
